public class WebACLFactory(string resourceName = null, Action<Humidifier.WAFv2.WebACL> factoryAction = null) : ResourceFactory<Humidifier.WAFv2.WebACL>(resourceName)
{

    internal List<InnerWebACLRuleFactory> RulesFactories { get; set; } = [];

    internal InnerWebACLAssociationConfigFactory AssociationConfigFactory { get; set; }

    internal InnerWebACLDefaultActionFactory DefaultActionFactory { get; set; }

    internal InnerWebACLChallengeConfigFactory ChallengeConfigFactory { get; set; }

    internal InnerWebACLVisibilityConfigFactory VisibilityConfigFactory { get; set; }

    internal InnerWebACLCaptchaConfigFactory CaptchaConfigFactory { get; set; }

    protected override Humidifier.WAFv2.WebACL Create()
    {
        var webACLResult = CreateWebACL();
        factoryAction?.Invoke(webACLResult);

        return webACLResult;
    }

    private Humidifier.WAFv2.WebACL CreateWebACL()
    {
        var webACLResult = new Humidifier.WAFv2.WebACL
        {
            GivenName = InputResourceName,
        };

        return webACLResult;
    }
    public override void CreateChildren(Humidifier.WAFv2.WebACL result)
    {
        base.CreateChildren(result);

        result.Rules = RulesFactories.Any() ? RulesFactories.Select(x => x.Build()).ToList() : null;
        result.AssociationConfig ??= AssociationConfigFactory?.Build();
        result.DefaultAction ??= DefaultActionFactory?.Build();
        result.ChallengeConfig ??= ChallengeConfigFactory?.Build();
        result.VisibilityConfig ??= VisibilityConfigFactory?.Build();
        result.CaptchaConfig ??= CaptchaConfigFactory?.Build();
    }

} // End Of Class

